The reasons to love the Loire today are as numerous as its dazzling roster of styles, grapes and subregions. Across the wine industry, many consider the Loire Valley to be something of a secret weapon. We talk to three wine pros—@zwanng, @susanrlin and @michaelcorsoselections—about why the Loire has become a perennial wine industry darling, what they love about the region and their favorite bottles to seek out. ⁠
@LoireValleyWine #punchpartner #LoireLovers⁠
📷: @lizzieamunro⁠
